Well hellooo there! Finally fruit is setting nicely. This is a mission tree from deep in the SY Valley, planted about 20 years ago. Mission trees, while indigenous to our region, are the most difficult to care for. But after 25 years, we sure know how! We love the oil and so do you! Thank you for making “Big Butter, Big Fruit” a  customer favorite. Did you know fresh olive oil has significant tasting notes of terroir of the region? Bees don’t pollinate olive trees. So the soil, environment, climate all gather around, creating flavor and finish. (And don’t forget the polyphenols!) Fruit set time is the most vulnerable. High winds, excessive heat and not enough water can fry these babies in a nanosecond. It’s bottle feeding time! (Feels like it🤣) Make your appointment today or even walk in for your Olive Oil Certified Sommelier tasting~we’re the experts and here to help choose the best olive oil for baking, frying, bbq or desserts! Our in house Chef Lisa has all the answers and recipes too. Yes you CAN & SHOULD cook with REAL olive oil! 

