Baking with walnut oil or olive oil is a plus when you’re looking for what bakers call “the perfect crumb”. Let us teach you how! Start with fresh ingredients. Here’s Chef Lisa’s recipe for this week’s Global Gardens Santa Ynez Provisions Store sample. Don’t tell anyone but it’s gluten free too😎
52 weeks of tastes from our family to yours. #glutenfree #healthylifestyle

Chef Lisa’s Best Banana Bread
Gluten Free!

Ingredients:

¼ Cup Global Gardens Fresh Walnut Oil
½ Cup Plain All Purpose Gluten Free flour
2/3C Ground Almonds
⅓ C Chopped raw Walnuts (OR chocolate chips!) 
2 Teaspoon Baking Soda
1 ½ Teaspoon Global Gardens Dream Dust
4  Ripe Bananas
4 Tablespoons of  Honey or Agave + 1 Tablespoon for topping
2 Eggs
1 Teaspoon Vanilla extract
½ teaspoon salt

Method:
Preheat oven to 350°
Lightly oil 1 regular size bread loaf pan

In a large bowl, combine flour, ground almonds, baking soda, Dream Dust and salt.
Peel and mash three of the bananas in another large bowl, then add the oil, honey, eggs and vanilla extract. Whisk to combine. 
Mix dry ingredients well with a whisk or fork. Fold dry ingredients into the wet, being careful not to over-mix. A few lumps are fine. Fold in the walnuts until just combined, then pour the batter into the prepared bread loaf pan level to the surface.  Peel and slice remaining banana in half and decorate lengthwise on top of batter. (You can also use more ground nuts sprinkled on the top instead of banana.)

Bake for 40-45 minutes  or until the top of the loaf is deeply golden brown and a skewer inserted into the middle comes out clean. Immediately brush with the remaining honey while the loaf is still hot, then cool in the pan for 10 minutes before lifting onto a wire rack to cool completely.

